import logo from "./logo.svg";
import "./App.css";

function App() {
  var details = "My details is";
  var object = {
    name: "Asrhaf Uzzaman",
    occopation: "Web",
  };
  var style = {
    color: "red",
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>{details}</p>
        <ul className={style}>
          <li>{object.name}</li>
          <li>{object.occopation}</li>
        </ul>
        <span>My total math total number is {(5 + 5) * 9}</span>
      </header>
    </div>
  );
}

export default App;
